import React, { lazy } from "react";
import {
  CButton,
  CCard,
  CCardBody,
  CCol,
  CRow,
  CDropdown,
  CDropdownMenu,
  CDropdownItem,
  CDropdownToggle,
  CWidgetDropdown,
} from "@coreui/react";


import DbForm1 from "src/views/forms/DbChart1";


const OldData = () => {
  return (
    <>
      {/* This section is where all of the widgets go (i.e. line health, alarms, power consumption) */}
      <CRow>
        <DbForm1/>
      </CRow>
    </>
  );
};

export default OldData;
